    marginTop: 16,
    width: "100%",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: 0,
    "& button": {
      width: "30%",
    },
  },
}));

const BetButtonBar = ({ teamA, teamB, draw, gameStatus }) => {
  const classes = useStyles();
  return (
    <Container className={classes.root}>
      {
        gameStatus === "PLAYING"
      }
    </Container>
  );
};

export default BetButtonBar;
